import { useState, useEffect } from "react";
import CompanyModal from "../../Common/CompanyModal";
import LoanTextField from "../../../Common/LoanTextField";
import { Select, FormControl, MenuItem, InputLabel } from "@mui/material";
import CommonServices from "../../Common/CommonServices";
// import AddSoleDependent from "./AddSoleDependent";
const ViewSoleDependent = ({
  holdSoleDependent,
  isCompanySoleDependentModalOpen,
  handleCompanySoleDependentCloseModal,
  handleCompanySoleDependentOpenModal,
  soleID, //well transfer to add sole dependent
}) => {
  const [country, setContry] = useState([]);
  const [proofOfIdentityType, setProofOfIdentityType] = useState([]);
  const [dependentRelationshipType, setDependentRelationshipType] = useState([]);
  const [
    isCompanySoleDependentEditedModalOpen,
    setIsCompanySoleDependentEditedModalOpen,
  ] = useState(false);
  function handleCompanySoleDependentEditCloseModal() {
    setIsCompanySoleDependentEditedModalOpen(false);
  }
  function handleCompanySoleDependentEditedModalOpen() {
    setIsCompanySoleDependentEditedModalOpen(true);
  }
  function handleCompanyMarriedInformationEditCloseModal() {
    setIsCompanySoleDependentEditedModalOpen(false);
  }
  const [dependentId, setDependentId] = useState();
  const [editSoleDependent, setEditSoleDependent] = useState({
    Id: dependentId,
    FirstName: "",
    MiddleName: "",
    LastName: "",
    NationalityId: "",
    CountryOfOriginId: "",
    CountryOfResidenceId: "",
    ProofOfIdentityTypeId: "",
    ProofOfIdentityFile: "",
    ProofOfIdentityIssueDate: "",
    ProofOfIdentityExpirDate: "",
    DependentRelationshipTypeId: "",
    BirthCertificate: "",
    BirthCertificateIssuer: "",
  });
  const handleInputChangeEditDependent = (event) => {
    const { name, value } = event.target;
    setEditSoleDependent({ ...editSoleDependent, [name]: value });
  };
  const getDependentById = (taxInformationId) => {
    CommonServices.getDependentById(taxInformationId)
      .then((res) => {
        setEditSoleDependent({
          ...editSoleDependent,
          Id: taxInformationId,
          FirstName: res.data.Result.FirstName,
          MiddleName: res.data.Result.MiddleName,
          LastName: res.data.Result.LastName,
          NationalityId: res.data.Result.NationalityId,
          CountryOfOriginId: res.data.Result.CountryOfOriginId,
          CountryOfResidenceId: res.data.Result.CountryOfResidenceId,
          ProofOfIdentityTypeId: res.data.Result.ProofOfIdentityTypeId,
          ProofOfIdentityFile: res.data.Result.ProofOfIdentityFile,
          ProofOfIdentityIssueDate: res.data.Result.ProofOfIdentityIssueDate,
          ProofOfIdentityExpirDate: res.data.Result.ProofOfIdentityExpirDate,
          DependentRelationshipTypeId:
            res.data.Result.DependentRelationshipTypeId,
          BirthCertificate: res.data.Result.BirthCertificate,
          BirthCertificateIssuer: res.data.Result.BirthCertificateIssuer,
        });
      })
      .catch((err) => console.log(err));
  };
  useEffect(() => {
    getDependentById();
  }, []);
  const updateDependent = () => {
    CommonServices.updateDependent(dependentId, editSoleDependent)
      .then((response) => {})
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    updateDependent();
  }, []);
  const fetchContry = () => {
    CommonServices.getCountry()
      .then((response) => {
        setContry(response.data.Result);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    fetchContry();
  }, []);
  const fetchProofOfIdentityType = () => {
    CommonServices.getProofOfIdentityTypes()
      .then((response) => {
        setProofOfIdentityType(response.data.Result);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    fetchProofOfIdentityType();
  }, []);
  
  const fetchsetDependentRelationship= () => {
    CommonServices.getDependent()
      .then((response) => {
        setDependentRelationshipType(response.data.Result);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    fetchsetDependentRelationship();
  }, []);
  //add dependent
  
  const [toggleSoleDependent, setToggleSoleDependent] = useState(false);
  const initialSoleDependentState = {
    Id: null,
    FirstName: "",
    MiddleName: "",
    LastName: "",
    NationalityId: "",
    CountryOfOriginId: "",
    CountryOfResidenceId: "",
    ProofOfIdentityTypeId: "",
    ProofOfIdentityFile: "",
    ProofOfIdentityIssueDate: "",
    ProofOfIdentityExpirDate: "",
    DependentRelationshipTypeId: "",
    BirthCertificate: "",
    BirthCertificateIssuer: "",
  };
  const [soleDependent, setSoleDependent] = useState(initialSoleDependentState);
 const handleInputChangeSoleDependent = (event) => {
    const { name, value } = event.target;
    setSoleDependent({ ...soleDependent, [name]: value });
  };
const saveSoleDependent = () => {
    var data = {
      FirstName: soleDependent.FirstName,
      MiddleName: soleDependent.MiddleName,
      LastName: soleDependent.LastName,
      NationalityId: soleDependent.NationalityId,
      CountryOfOriginId: soleDependent.CountryOfOriginId,
      CountryOfResidenceId: soleDependent.CountryOfResidenceId,
      ProofOfIdentityTypeId: soleDependent.ProofOfIdentityTypeId,
      ProofOfIdentityFile: soleDependent.ProofOfIdentityFile,
      ProofOfIdentityIssueDate: soleDependent.ProofOfIdentityIssueDate,
      ProofOfIdentityExpirDate: soleDependent.ProofOfIdentityExpirDate,
      DependentRelationshipTypeId: soleDependent.DependentRelationshipTypeId,
      BirthCertificate: soleDependent.BirthCertificate,
      BirthCertificateIssuer: soleDependent.BirthCertificateIssuer,
    };
 CommonServices.SoleDependent(data, soleID)
      .then((response) => {
        setSoleDependent({
          Id: response.data.Id,
          FirstName: response.data.FirstName,
          MiddleName: response.data.MiddleName,
          LastName: response.data.LastName,
          NationalityId: response.data.NationalityId,
          CountryOfOriginId: response.data.CountryOfOriginId,
          CountryOfResidenceId: response.data.CountryOfResidenceId,
          ProofOfIdentityTypeId: response.data.ProofOfIdentityTypeId,
          ProofOfIdentityFile: response.data.ProofOfIdentityFile,
          ProofOfIdentityIssueDate: response.data.ProofOfIdentityIssueDate,
          ProofOfIdentityExpirDate: response.data.ProofOfIdentityExpirDate,
          DependentRelationshipTypeId:
            response.data.DependentRelationshipTypeId,
          BirthCertificate: response.data.BirthCertificate,
          BirthCertificateIssuer: response.data.BirthCertificateIssuer,
        });
      })
      .catch((e) => {
        console.log(e);
      });
  };
  //end dependent
  return (
    <div>
      <CompanyModal
        isOpen={isCompanySoleDependentModalOpen}
        onClose={handleCompanySoleDependentCloseModal}
        title="view dependent information"
      >
        <div className="rounded-lg overflow-hidden">
          {holdSoleDependent ? (
            <table className="table table-bordered table-striped bg-purple-100">
              <thead>
                <th className="px-2 py-4"> Name</th>
                <th className="px-2 py-4"> Nationality</th>
                <th className="px-2 py-4"> Country Of Origin</th>
                <th className="px-2 py-4"> Country Of Residence</th>
                <th className="px-2 py-4"> Proof Of Identity Type</th>
                <th className="px-2 py-4"> Proof Of Identity</th>
                <th className="px-2 py-4"> Marriage Date</th>
                <th className="px-2 py-4"> Marriage Certificate Issuer</th>
                <th className="px-2 py-4"> Proof Of Identity Issue Date</th>
                <th className="px-2 py-4"> Proof Of Identity Expir Date</th>
                <th className="px-2 py-4"> Action </th>
              </thead>
              <tbody>
                <tr>
                  <td>
                    {holdSoleDependent.FirstName} {holdSoleDependent.MiddleName}{" "}
                    {holdSoleDependent.LastName}
                  </td>
                  <td>{holdSoleDependent.NationalityId}</td>
                  <td>{holdSoleDependent.CountryOfOriginId}</td>
                  <td>{holdSoleDependent.CountryOfResidenceId}</td>
                  <td>{holdSoleDependent.ProofOfIdentityTypeId}</td>
                  <td>{holdSoleDependent.ProofOfIdentityFile}</td>
                  <td>{holdSoleDependent.ProofOfIdentityIssueDate}</td>
                  <td>{holdSoleDependent.ProofOfIdentityExpirDate}</td>
                  <td>{holdSoleDependent.DependentRelationshipTypeId}</td>
                  <td>{holdSoleDependent.BirthCertificate}</td>
                  <td>{holdSoleDependent.BirthCertificateIssuer}</td>
                  <td>
                    <button
                      onClick={() => {
                        handleCompanySoleDependentEditedModalOpen();
                        getDependentById(holdSoleDependent.Id);
                      }}
                      className="text-purple-600 rounded-md font-semibold "
                    >
                      Edit
                    </button>
                  </td>                  
                </tr>
              </tbody>
            </table>
          ) : (
            ""
          )}
<button
        onClick={() => setToggleSoleDependent(!toggleSoleDependent)}
        className="text-purple-600 rounded-md font-medium "
      >
        Add Married
      </button>
      {toggleSoleDependent && (
        <div className="submit-form">
          {submitted ? (
            <div>
              <h4>You submitted successfully!</h4>
            </div>
          ) : (
            <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
              <LoanTextField
                id="FirstName"
                label="FirstName"
                value={soleDependent.FirstName}
                onChange={handleInputChangeSoleDependent}
                name="FirstName"
              />
              <LoanTextField
                id="MiddleName"
                label="MiddleName"
                value={soleDependent.MiddleName}
                onChange={handleInputChangeSoleDependent}
                name="MiddleName"
              />
              <LoanTextField
                id="LastName"
                label="LastName"
                value={soleDependent.LastName}
                onChange={handleInputChangeSoleDependent}
                name="LastName"
              />
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Nationality{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (soleDependent.NationalityId = event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {country.map((yourCounty) => (
                    <MenuItem
                      key={yourCounty.Id}
                      NationalityID={yourCounty.Id}
                      value={yourCounty.Id}
                    >
                      {yourCounty.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Country Of Origin{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (soleDependent.CountryOfOriginId = event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {country.map((yourCounty) => (
